import React from "react";


import "./CenteredContainer.css"
import ImageContainer from "./ImageContainer";

const CenteredContainer = props => {
    return (
        <div className="container centered-container">
            <div className="row">
                <ImageContainer />
                <ContentContainer />
            </div>
        </div>
    );
};

export default CenteredContainer;
